import { Button } from '@material-ui/core';
import { makeStyles } from '@material-ui/core/styles';

const useStyles = makeStyles({
    root: {
        display: 'flex',
        alignItems: 'center'
    }
})

function Login() {
    return (
        <div>
            <Button variant="contained" color="primary">Hello worlds</Button>
        </div>
    )
}

export default Login;
